import FeedbackItem from './components/FeedbackItem'
import FeedbackStatistics from './components/FeedbackStatistics'

export default function FeedbackList({data,handleRemove}) {
  return (
    <>
      <FeedbackStatistics/>
    {data.map((item =>{
        return (
  <div key={item.id}><FeedbackItem data={data} text={item.text} id={item.id} rating = {item.rating} handleRemove={ handleRemove} /></div>
        )
    }))}
    </>
 )
}
